import './App.css';

function App() {
  function nomeCompleto (nome, sobrenome) {
    return (
      <div>
        <p>Nome: {nome}.</p>
        <p>Sobrenome: {sobrenome}.</p>
        <p>Nome completo: {nome} {sobrenome}.</p>
      </div>
    )
  }
  const nome = 'Jansen'
  const sobrenome = 'Lima'
  return nomeCompleto(nome, sobrenome)
}

export default App;
